import React from 'react';

class List extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    if (this.props.data.length > 0) {
      return (
        <div className="List">
          {this.props.data.map(beer => <ListElem key={beer.id} beer={beer} />)}
        </div>
      );
    }
    return (
      <div>
        NOT FOUND
      </div>
    );
  }
}

export default List;
